import React from "react";

const Forecast = (props) => {
  return (
    <div>
      {props.responseObj.cod === 200 ? (
        <div>
          <p>
            <strong>{props.weather.name}</strong>
          </p>
          <p>
            It is currently {Math.round(props.weather.main.temp)} degrees out
            with {props.weather.weather[0].description}.
          </p>
        </div>
      ) : null}
    </div>
  );
};
export default Forecast;
